--
-- Create procedure `Proc_GetEmployeePaging`
--
CREATE PROCEDURE Proc_GetEmployeePaging (IN t_Filter varchar(255), IN t_PageIndex int, IN t_PageSize int, OUT t_TotalRecord int, OUT t_RecordStart int, OUT t_RecordEnd int)
SQL SECURITY INVOKER
COMMENT 'Phân trang'
BEGIN
  -- Lấy dữ liệu theo điều kiện (lấy những nhân viên theo mã hoặc họ và tên có chứa từ khóa)
  CREATE OR REPLACE TABLE tbEmployeeFilter
  SELECT
    ROW_NUMBER() OVER (ORDER BY ve.CreatedDate DESC) AS STT,
    ve.EmployeeID,
    ve.EmployeeCode,
    ve.EmployeeName,
    ve.Gender,
    ve.DepartmentId,
    ve.DateOfBirth,
    ve.IdentityNumber,
    ve.IdentityDate,
    ve.IdentityPlace,
    ve.Address,
    ve.PhoneNumber,
    ve.PhoneStatic,
    ve.Email,
    ve.PositionName,
    ve.DepartmentName,
    ve.BankNumber,
    ve.BankName,
    ve.BankBranchName,
    ve.CreatedDate,
    ve.CreatedBy,
    ve.ModifiedDate,
    ve.ModifiedBy
  FROM View_Employee ve
  WHERE (t_Filter IS NULL)
  OR (ve.EmployeeCode LIKE CONCAT('%', t_Filter, '%')
  OR ve.EmployeeName LIKE CONCAT('%', t_Filter, '%'));

  SET @recordStart = (t_PageIndex - 1) * t_PageSize + 1;
  SET @recordEnd = t_PageIndex * t_PageSize;

  SET t_RecordStart = @recordStart;
  SET t_RecordEnd = @recordEnd;
  SET t_TotalRecord = (SELECT
      COUNT(ef.EmployeeCode)
    FROM tbEmployeeFilter ef);
  SELECT
    *
  FROM tbEmployeeFilter ef
  WHERE STT BETWEEN @recordStart AND @recordEnd;

-- Thực hiện phân trang
END
$$

